  useEffect(() => {
    console.log('API Call..')
  }, [])

  const onSubmit = (event) => {
    event.preventDefault()
  }


  return(
    <div>
      <form onSubmit={onSubmit}>
        <input 
          type="text" 
          placeholder="검색어를 입력하세요..."
          value={keyWord}
          onChange={txt => setKeyWord(txt)}/>
        <button>Search</button>
      </form>
    </div>
    )
}

